import Card from './Card';
export default function Cards(props) {
   const onClose = () => window.alert('Emulamos que se cierra la card');
   return (
      <div>
         {props.characters.map(({id, name, species, gender, image}) => {
            return <Card
               key={id}
               name={name}
               species={species}
               gender={gender}
               image={image}
               onClose={onClose}
            />
         })}
      </div>
   );
}
